import "./Auth.css"
import { useAuth } from "../../context/auth-context"
import { validateNumber } from "../../utils/number-regex"
import { validateName } from "../../utils/name-regex"
import { validatePassword } from "../../utils/password-regex"
import { validateEmail } from "../../utils/email-regex"

export const AuthSignUp = () =>{
    const {name,number,email,password,authDispatch,confirmPassword} = useAuth()

    const handleNumberChange = (e) =>{
        const isNumberValid = validateNumber(e.target.value)
        if (isNumberValid){
            authDispatch({
                type:"NUMBER",
                payload:e.target.value
            })
        }
        else{
            console.log("Invalid Number")
        }

    }
    const handleNameChange = (e) =>{
        const isNameValid = validateName(e.target.value)
        if(isNameValid){
            authDispatch({
                type:"NAME",
                payload:e.target.value
            })
        }else{
            console.log("Invalid Name")
        }

    }
    const handleEmailChange = (e) =>{
        const isEmailValid = validateEmail(e.target.value)
        if(isEmailValid){
            authDispatch({
                type:"EMAIL",
                payload:e.target.value
            })
        }else{
            console.log("Invalid Email")
        }

    }
    const handlePasswordChange = (e) =>{
        const isPassValid = validatePassword(e.target.value)
        if(isPassValid){
            authDispatch({
                type:"PASSWORD",
                payload:e.target.value
            })
        }
        else{
            console.log("Invalid Password")
        }

    }
    const handleConfirmPasswordChange = (e) =>{
        isConfirmPassValid = validatePassword(e.target.value)
        if(isConfirmPassValid){
            authDispatch({
                type:"CONFIRM_PASSWORD",
                payload:e.target.value
            })
        }
        else{
            console.log("Invalid confirm password")
        }

    }
    return(
        <div className="auth-container">
        <form >
          <div className="d-flex direction-column lb-in-container">
            <label className="auth-label">
              Mobile Number <span className="asterisk">*</span>{" "}
            </label>
            <input
            value={number}
              type="number"
              className="auth-input"
              maxLength="10"
              placeholder="Enter Mobile Number"
              required
              onChange={handleNumberChange}
            />
          </div>
          <div className="d-flex direction-column lb-in-container">
            <label className="auth-label">
              Name <span className="asterisk">*</span>{" "}
            </label>
            <input
            value={name}
              className="auth-input"
              placeholder="Enter Name"
              required
              onChange={handleNameChange}
            />
          </div>
          <div className="d-flex direction-column lb-in-container">
            <label className="auth-label">
              Email <span className="asterisk">*</span>{" "}
            </label>
            <input
            value={email}
              className="auth-input"
              placeholder="Enter Email"
              type="email"
              required
              onChange={handleEmailChange}
            />
          </div>
          <div className="d-flex direction-column lb-in-container">
            <label className="auth-label">
              Password <span className="asterisk">*</span>{" "}
            </label>
            <input
                value={password}
              className="auth-input"
              placeholder="Enter Password"
              type="password"
              required
              onChange={handlePasswordChange}
            />
          </div>
          <div className="d-flex direction-column lb-in-container">
            <label className="auth-label">
              Confirm Password <span className="asterisk">*</span>{" "}
            </label>
            <input
             value={confirmPassword}
              className="auth-input"
              placeholder="Enter Password"
              type="password"
              required
              onChange={handleConfirmPasswordChange}
           
            />
          </div>
          <div>
            <button className="button btn-primary btn-login cursor">
              Submit
            </button>
          </div>
        </form>
      </div>
    )
}
